# Row Major to Column Major Sprite converter
# Sample data generated by BMP2Tile
# 432 / 3 = 144 

# Sprites are divided into 8x8 pixel characters or tiles
# To handle large sprites such as objects in c64 games of 24x21 pixels.
# Sprites are re-worked to 24x24 pixel plane / 3x3 characters and re-centered using something like Asperite
# The resulting image is then converted to non-planar data using BMP2Tile then parsed through this tool for the correct orientation

#;Sample code to handle and display a sprite
#;For full explanation, see https://github.com/BigEvilCorporation/megadrive_samples/blob/master/3_sprites/sprites.asm

#vram_addr_sprite_table	equ $F000
#size_tile_b			equ $20 ; each tile is 32 bytes, see sample data
#tile_count			equ 254	; Last tile index is the end of your background chars, sprites come after.
#tile_id_sprite_1		equ $ff ; Sprites begin after the character set

#; The sprite plane is 512x512 pixels, but is offset by
#; -128 pixels in both X and Y directions. To see a sprite
#; on screen at 0,0 we need to offset its position by
#; this border.
#vdp_sprite_border_x		equ $80
#vdp_sprite_border_y		equ $80

#;Sprite initial draw positions (in pixels)
#sprite_1_start_pos_x		equ vdp_sprite_border_x
#sprite_1_start_pos_y		equ vdp_sprite_border_y+$0040

#;==============================================================
#; Write the sprites tiles to VRAM
#;==============================================================
#SetVRAMWriteConst (vram_addr_tiles+size_tile_b)+tile_count*size_tile_b
#; Write the sprite tiles to VRAM
#lea    SpritesManta,a0						; Move the address of the first graphics tile into a0
#move.w #(sprite_count*(size_tile_l))-1,d0			; Loop counter = 8 longwords per tile * num tiles (-1 for DBRA loop)
#SpriteLp:							; Start of loop
#move.l (a0)+,vdp_data						; Write tile line (4 bytes per line), and post-increment address
#dbra d0,SpriteLp						; Decrement d0 and loop until finished (when d0 reaches -1)

#;==============================================================
#; Displaying a 3x3 sprite ( %1010 = 3x3 )
#;==============================================================
#SetVRAMWriteConst vram_addr_sprite_table
#BuildSpriteStructure sprite_1_start_pos_x,sprite_1_start_pos_y,%1010,$1,$0,$0,$0,$0,tile_id_sprite_1,d0,d1,d2,d3
#;Write the entire sprite attribute structure to the sprite table
#move.w d0,vdp_data
#move.w d1,vdp_data
#move.w d2,vdp_data
#move.w d3,vdp_data
#;==============================================================
#; Intitialise variables in RAM
#;==============================================================
#move.w #sprite_1_start_pos_x,ram_sprite_1_pos_x
#move.w #sprite_1_start_pos_y,ram_sprite_1_pos_y


import re

def parse_assembler_data(data):
    pattern = re.compile(r'; Tile index,\$(\w+)\n\s*dc.b (.+)')
    tiles = pattern.findall(data)
    return tiles

def rearrange_data(tiles):
    rearranged_data = []
    num_tiles = len(tiles)
    

    for i in range(num_tiles):
        group = (i // 3) * 1
        new_index = (i % 3) * 144 + group
        if new_index < num_tiles:
            rearranged_data.append(tiles[new_index])

    return rearranged_data

def format_output(rearranged_data):
    output = ""
    sprite_frame = 0
    
    for index, data in rearranged_data:
        output += f"dc.b {data}\n"
        #output += f"; Tile index,${index}\n\tdc.b {data}\n"
    return output


